import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


ReactDOM.render(
  <React.StrictMode>
      <h1>My Name is Kali</h1> 
      <p>I am from Hyd</p>    
      <h1>I am a full stack developer</h1>        
  </React.StrictMode>,
  document.getElementById('root')
);
